import React, { useState, useEffect } from 'react'
import { Link, useNavigate } from 'react-router-dom'
export default function ViewOrders() {
    const [orders, setOrders] = useState([])
    const [search, setSearch] = useState('')
    let navigate = useNavigate()
    const loadOrders = async () => {
        let response = await fetch("http://localhost:5000/api/auth/fetchgyjorderData", {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            }
        }).then(async (res) => {
            let response = await res.json()
            await setOrders(response);

        })
    }

    useEffect(() => {
        loadOrders()
    }, [])
    return (
        <>
            <div>
                <nav class="navbar navbar-light bg-light">
                    <div class="container">
                        <Link className="navbar-brand fs-1 fst-italic" to="/admin">GetYourJewellery</Link>
                        <form class="d-flex">
                            <input class="form-control me-2 border-secondary" type="search" placeholder="Search Order" aria-label="Search" value={search} onChange={(e) => { setSearch(e.target.value) }} />
                            <button class="btn btn-outline-secondary" onClick={() => { setSearch('') }}>Search</button>
                        </form>
                    </div>
                </nav>
            </div>
            <div className='mt-3'>
                <div className='m-auto mt-2 table-responsive  table-responsive-sm table-responsive-md' >
                    <table className='table table-hover '>
                        <thead className=' text-secondary fs-4'>
                            <tr className='bg-white'>
                                <th scope='col' >Order Date</th>
                                <th scope='col' >Customer Email</th>
                                <th scope='col' >Product Id</th>
                                <th scope='col' >Product Name</th>
                                <th scope='col' >Qty</th>
                                <th scope='col' >Category</th>
                                <th scope='col' >Dealer</th>
                                <th scope='col' >Amount</th>
                            </tr>
                        </thead>
                        <tbody>
                        {orders.length > 1 ? orders.filter(
                            (data) => (data.email.toLowerCase().includes(search.toLowerCase())))
                            .map((order) => {

                                return (
                                    <tr>
                                        <Link className='text-secondary' to="/fetchorders" state={{ userEmail: order.email }}><th scope='row' >{order._id}</th></Link>
                                        <td>{order.email}</td>
                                        <td>{order.order_data.order_date}</td>
                                        
                                    </tr>
                                )
                            })
                            : "No User Found"}
                    </tbody>
                        <tbody>
                            {orders.length >= 1 ? orders.filter(
                                (data) => (data.email.toLowerCase().includes(search.toLowerCase())))
                                .map((order) => {
                                    console.log(order.order_data.sort((a, b) => {
                                        return a.order_data[0] - b.order_data[0];
                                    }));
                                    return (
                                        <>

                                            {order.order_data.length >= 1 ? order.order_data.map(item => {
                                                
                                                return (
                                                    <>
                                                        {Array.from(Array(item.length - 1), (e, i) => {
                                                            
                                                            return (
                                                                <tr key={i + 1} value={i + 1}>
                                                                    <td>{Object.values(item[0])}</td>
                                                                    <td>{order.email}</td>
                                                                    <td >{Object.values(item[i + 1].id)}</td>
                                                                    <td>{Object.values(item[i + 1].name)}</td>
                                                                    <td>{Object.values(item[i + 1])[2]}</td>
                                                                    <td>{Object.values(item[i + 1])[4]}</td>
                                                                    <td>{Object.values(item[i + 1].dealer)}</td>
                                                                    <td>{Object.values(item[i + 1])[3]*Object.values(item[i + 1])[2]}</td>                                                                   
                                                                </tr>
                                                            )
                                                        })}

                                                    </>
                                                )
                                            }) : ""}


                                        </>
                                    )
                                })
                                : "No Order Found"}
                        </tbody>
                    </table>


                </div>
            </div>

        </>
    )
}
